    // 潮汐データを抽出
    function extract_time_from_data($data, $keys) {
        $times = [];
        foreach($data as $key => $value) {
            if(in_array($key, $keys)) {
                foreach($value as $item) {
                    if(isset($item['time'])) {
                        $times[] = ['time' => $item['time'], 'type' => $key];
                    }
                }
            } elseif(is_array($value)) {
                $times = array_merge($times, extract_time_from_data($value, $keys));
            }
        }
        return $times;
    }

